import React from "react";
import img5 from '../images/arijit.png';
import img6 from '../images/aujla.png';
import i from '../images/shreya.png';
import img4 from '../images/neha.png';
import './standup.css';

const StandUp=()=>{

    return(
        <div className="upper">
        
            <div className="First">
                
                <img src={img1} alt=""/>
               
            </div>

            <div className="First">
                
               
                <img src={img2} alt=""/>
            </div>


            <div className="First">
                
                <img src={i} alt=""/>
               
            </div>

            <div className="First">
                
                <img src={img4} alt=""/>
            </div>

        </div>
    )
}
export default StandUp;
